def normalize1(lst):#EAR
    
    normalized = []
    
    for value in lst:
        normalized_num = (value) - a1#평균빼주기=>zero centered data
        normalized_num/=s1#분산 나누기=> normalized data
        normalized.append(normalized_num)
    return normalized

def normalize2(lst):#EAR
    
    normalized = []
    
    for value in lst:
        normalized_num = (value) - a2#평균빼주기=>zero centered data
        normalized_num/=s2#분산 나누기=> normalized data
        normalized.append(normalized_num)
    return normalized

def n1(num1):#Test EAR
    normalize=0
    normalize=num1-a1
    normalize/=s1
    return normalize

def n2(num2):#Test MAR
    normalize=0
    normalize=num2-a2
    normalize/=s2
    return normalize


