def s_normalize1(lst):#EAR
    normalized = []
    
    for value in lst:
        normalized_num = (value) - s_a1#평균빼주기=>zero centered data
        normalized_num/=s_s1#분산 나누기=> normalized data
        normalized.append(normalized_num)
    return normalized

def s_normalize2(lst):#EAR
    
    normalized = []
    
    for value in lst:
        normalized_num = (value) - s_a2#평균빼주기=>zero centered data
        normalized_num/=s_s2#분산 나누기=> normalized data
        normalized.append(normalized_num)
    return normalized

def s_n1(num1):#Test EAR
    normalize=0
    normalize=num1-s_a1
    normalize/=s_s1
    return normalize

def s_n2(num2):#Test MAR
    normalize=0
    normalize=num2-s_a2
    normalize/=s_s2
    return normalize
